def plot_rrmse(selected_car, results):
    sizes = sorted(results.keys())


    phys_rrmse = []
    xgb_rrmse = []
    xgb_std = []
    lr_rrmse = []
    lr_std = []
    only_ml_rrmse = []
    only_ml_std = []

    for size in sizes:
        # Physics-Based 모델의 rrmse 값이 리스트가 아닌 경우 리스트로 변환
        phys_values = [item for result in results[size] if result['model'] == 'Physics-Based' for item in result['rrmse']]
        xgb_values = [item for result in results[size] if result['model'] == 'Hybrid Model(XGBoost)' for item in result['rrmse']]
        lr_values = [item for result in results[size] if result['model'] == 'Hybrid Model(Linear Regression)' for item in result['rrmse']]
        only_ml_values = [item for result in results[size] if result['model'] == 'Only ML(XGBoost)' for item in result['rrmse']]

        if phys_values:
            phys_rrmse.append(np.mean(phys_values))
        if xgb_values:
            xgb_rrmse.append(np.mean(xgb_values))
            xgb_std.append(2 * np.std(xgb_values))  # 2σ 계산
        if lr_values:
            lr_rrmse.append(np.mean(lr_values))
            lr_std.append(2 * np.std(lr_values))  # 2σ 계산
        if only_ml_values:
            only_ml_rrmse.append(np.mean(only_ml_values))
            only_ml_std.append(2 * np.std(only_ml_values))  # 2σ 계산

    plt.figure(figsize=(10, 6))

    # Physics-Based 모델
    plt.plot(sizes, phys_rrmse, label='Physics-Based', linestyle='--', color='r')

    # Hybrid Model(XGBoost)
    plt.errorbar(sizes, xgb_rrmse, yerr=xgb_std, label='Hybrid Model(XGBoost)', marker='o', capsize=5)

    # Hybrid Model(Linear Regression)
    plt.errorbar(sizes, lr_rrmse, yerr=lr_std, label='Hybrid Model(Linear Regression)', marker='o', capsize=5)

    # Only ML(XGBoost)
    plt.errorbar(sizes, only_ml_rrmse, yerr=only_ml_std, label='Only ML(XGBoost)', marker='o', capsize=5)

    plt.xlabel('Number of Trips')
    plt.ylabel('RRMSE')
    plt.title(f'RRMSE vs Number of Trips for {selected_car}')
    plt.legend()
    plt.grid(True)

    plt.xscale('symlog', linthresh=20)
    plt.xticks(sizes, [str(size) for size in sizes], rotation=45)
    plt.xlim(min(sizes) - 1, max(sizes) + 1000)
    plt.show()

# Plot for each car
for car in results_dict.keys():
    plot_rrmse(car, results_dict[car])